import React from "react";
import styled from "styled-components";

const AppMain = styled.main`
  margin-top: 56px;
  overflow: auto;
  width: 100%;
  margin-left: ${({ theme }) => theme.menuWidth};
`;

export const Main = ({ children }) => {
  return <AppMain>{children}</AppMain>;
};
